import React, {useState, useEffect} from "react";

import { View, Text, TextInput, Button } from 'react-native';
import { Form } from "redux-form";

const MapForm = () => {
  return (
    <View>
      <Form>
        <Text>Create Map</Text>
        <TextInput
          className = "name"
          type = "text"
          placeholder = "Name"
        />
        <TextInput
        className = "id"
        type = "text"
        placeholder = "Site id"
      />
      <TextInput
      className = "name"
      type = "text"
      placeholder = "Name"
    />
      </Form>
    </View>
  );
};


export default MapForm;
